	// 创建或者修改评价
	$("body")
			.off("click", ".rating-submit")
			.on(
					"click",
					".rating-submit",
					function(event) {
						if ($(".choose-reason [data-act=diffError]").hasClass(
								"active")) {
							$scope.ratingObj.diffError = true;
							$scope.ratingObj.semanticError = false;
						} else if ($(".choose-reason [data-act=semanticError]")
								.hasClass("active")) {
							$scope.ratingObj.diffError = false;
							$scope.ratingObj.semanticError = true;
						}
						$scope.$apply();
						$scope.evaluateIntentFunc();
						// 将修改的意图添加到userLogs中
						for ( var i in $scope.userLogs) {
							if ($scope.ratingObj.logId == $scope.userLogs[i].response.logId) {
								$scope.userLogs[i].response.rating = $scope.ratingObj;
								$scope.$apply();
								$("#evaluateModal").modal("hide");
								break;
							}
						}
					});

