	// 用户的日志列表加载下一页
	var loadPageId = 1;
	var $loadMoreBox = true;
	$(".user-logs-box .logs").on(
			"scroll",
			function(e) {
				var $this = $(this);
				var scrollTopsize = $this[0].scrollTop;
				var scrollHeightsize = $this[0].scrollHeight;
				var board_boxsize = $this.height();
				var lastUserGmtCreate = new Date().getTime();
				var lastUserLog;
				if ($scope.userLogs && $scope.userLogs.length > 0) {
					lastUserLog = $scope.userLogs[$scope.userLogs.length - 1];
					lastUserGmtCreate = lastUserLog.request.gmt_create;
				}
				if (scrollTopsize >= (scrollHeightsize - board_boxsize - 30)
						&& $loadMoreBox == true) {
					$loadMoreBox = false;
					var my_user_id = $stateParams.user_id;
					my_user_id = my_user_id.replace(/爨/g,":");
					$.ajax({
						url : ruyiai_host + "/ruyi-ai/" + appId + "/"
								+ my_user_id + "/log",
						data : {
							"minTime" : lastUserGmtCreate,
							"maxTime" : 1459440000000,
							"size" : $scope.pageSize
						},
						method : "GET",
						success : function(data) {
							if (data.code == 0) {
								var userLogs = data.result;
								if (userLogs.length > 0) {
									for ( var i in userLogs) {
										userLogs[i].resultJsonParse = JSON.stringify(userLogs[i],null,4);
										$scope.userLogs.push(userLogs[i]);
									}
									
									loadPageId++;
									$loadMoreBox = true;
									$scope.$apply();
									setTimeout(function() {
										$("[data-act=evaluate]").rating();
									}, 10);
								} else {
									$loadMoreBox = false;
								}
								if(RequestTwo.implantInfoManagement == "yes" && getCookie("currentCheckedAppId")){
									$("[data-act=evaluate-box-li]").css("display","none");
									$(".edit-icon").css("display","none");
								}
								$('[data-toggle="tooltip"]').tooltip(); //初始化提示
							}else if(data && data.code == 2){
								goIndex();
							}
						}
					});
				}
			})

	// 通过intentId，获取intent对象 start
	$scope.getIntentObjFunc = function(intentId) {
		// intentId = "7922e40d-3051-433b-b7a3-4fab0bf38084";
		$.ajax({
			url : ruyiai_host + "/ruyi-ai/" + appId + "/test/intent/"
					+ intentId,
			method : "GET",
			success : function(data) {
				if (data.code == 0) {
					var intentObj = data.result;
					window.location.href = "#/intent_list/"
							+ intentObj.scenarioId + "/intent_detail/"
							+ intentId;
				} else if (data.code == 2) {
					goIndex();
				} else {
					// if(data.msg){ $.trace(data.msg + "( "+ data.detail +" )","error"); }
					$.trace("系统意图，不能进行编辑");
				}
			}
		});
	}
	// 通过intentId，获取intent对象 end

	// 操作意图
	$scope.operationIntentFunc = function(response) {
		if (response && response.intents && response.intents.length > 0) {
			if (response.intents[0].score == 0) {// 创建意图
				window.location.href = "";
			} else {
				$scope.getIntentObjFunc(response.intents[0].id); // 编辑意图
			}
		} else {
			window.location.href = "";
		}
	}

